//导入核心库
import React from "react";
//引入ReactDOM
import ReactDOM from "react-dom/client";
//引入App组件
import App from "./App";

//渲染组件到页面
// ReactDOM.render(<App />, document.getElementById("root"));
const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<App />);
